Just something that I was thinking of tonight/morning ğŸ˜‰. I think it's okay to be at least obsessed about one thing in your life. I think we all need to find something that we can be obsessed about doing/achieving. You can call it your passion, you can call it your mission. For me, I call it my purpose in life.
.
Being really obsessed about what you do will always lead you to want to be the best that you can be at it. It's not necessarily in comparison to someone else's abilities. But here's the interesting thing about being passionate/obsessed about something, as a side effect of your drive and desire to be really good at what you do, you'd eventually find yourself in a place where you'd become the best at what you do.
.
It won't happen overnight, but if you keep pursuing that path of wanting to be better than you were yesterday, there's absolutely no limit to what you can accomplish in life.
